import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 50, clear: "both", paddingTop: 10, textAlign: "center" }}
      className="jumbotron border border-success"
    > <div> <br></br></div>
      {children}
    </div>
  );
}

export default Jumbotron;
